import React from "react"
import {Link} from "react-router-dom";

import "./Boxlink.css"

function getBoxLink(boxCase){
    if(boxCase === "Startseite")
        return '/'
    else
        return '/' + boxCase
}

function Boxlink(props){
    let boxClass;
    if(props.box.shape === "square")
        boxClass = "boxlink__square"
    else if(props.box.shape === "rectangle")
        boxClass = "boxlink__rectangle"
    else
        boxClass = "boxlink__bar"

    const boxLink = getBoxLink(props.box.case)
    alert(boxLink)
    return(
        <div className={boxClass}>
            <Link to={boxLink}> <h3>{props.box.case}</h3>  </Link>
        </div>
    )
}

export default Boxlink
